Depletion of high-abundant proteins is always the bottleneck in the area of biomarker discovery. Some new strategies of high-abundant protein depletion were proposed in addition to widely used immuno-affinity depletions. Gradiflow [66] is capable of separating proteins of different molecular weight and pI values to achieve the depletion of albumin in human plasma. Wasinger et al. [67] adopted Gradiflow strategy as the pre-fractionation step prior to 2D-LC–MS/MS analysis of human plasma proteome. Zhang's group [68] developed a novel strategy of multi-dimensional chromatography separation in intact protein level for the depletion of high-abundant proteins existed in rat liver tissue extraction, as shown in Fig. 3
. Protein samples were first separated with a SCX column and fractions were collected every 2 min. Then SCX fractions were loaded onto RPLC column, respectively. Peak intensity of RPLC chromatogram detected by UV absorption detection was used to distinguish high-abundant proteins from mid- and low-abundant proteins. RPLC fractions with peak intensity above 0.1AU were taken as high-abundant proteins and depleted. After separations, fractions of high-abundance proteins were tryptically digested and MS/MS analyzed, whereas other fractions defined as mid- and low-abundant proteins were pooled together and submitted for further RPLC-MS/MS analysis (Fig. 4
). The number of identified proteins was increased about three times in comparing to a 2D-LC due to the depletion of high-abundant proteins. This strategy was demonstrated to be more universal and low cost for proteome analysis.

Array-based electrophoretic strategies such as protein chips and capillary electrophoresis array have been successfully applied in genome and proteome research with their high throughput and fast analysis time. Chromatography array technology has some challenges because of the complexity and high requirements for HPLC systems. However, many progresses have been made toward this area. Horn et al. [76] presented a high-throughput procedure for proteome research of native constituents. Human serum sample was first separated with SEC column in a mild condition and collected in 96-well microplate. Ninety-six anion-exchange columns (AEC) were arranged just as 96-well microplate to separate SEC fractions in a parallel way. All fractions were submitted for quantitative assay and MS identification. The use of microplate as a medium made it possible to fulfill a high-throughput array separation. This can even increase the system resolution by the adoption of a third separation dimension. Our group developed a capillary array RPLC-based multi-dimensional separation systems coupled with MALDI-TOF-MS/MS for high-throughput proteome research [77], [78]. It includes a SCX column as the first dimension and 10 parallel capillary RPLC columns as the second dimension [77]. The schematic diagram was shown in Fig. 5
. Multiple channel interface was fabricated. Digested proteins extracted from liver cancer tissue were analyzed by the system. Over 1202 proteins were found with only one-tenth time needed in common 2D-LC system. An automated and optimized system was further developed [78]. Capillary SCX chromatographic column was used as the first dimension and 18 parallel capillary RPLC columns were integrated as the second separation dimension (Fig. 6
). Peptides bound to the SCX phase were eluted using gradient elution. Effluents were sequentially transferred onto each subset of precolumns. After salt fractionation peptide fractions were concurrently back-flushed from the precolumns and separated simultaneously with 18 capillary RP columns. LC effluents were directly deposited onto the MALDI target plates for subsequent MALDI experiments. An 18-fold increase in throughput compared with serial-based 2D-LC system was realized by this new system. The effectiveness of array-based MDLC/MS platform for separation and identification of a complex proteome sample demonstrated that it would be a powerful high-throughput way for large-scale proteome research.
